INSERT INTO `operator` VALUES (37,'BABS bus service','Buckie accessible community bus scheme. Covers Buckie, Cullen, Fochabers and Keith areas. Provides fully trained passenger assistants.',3,'Office Telephone: (01542) 835800 BABS Dial-a-Bus Ltd 11 March Road East Buckie AB56 4BY','0',NULL,NULL,'2015-05-06 11:11:12',NULL),(38,'BABS car service','Car hire with driver service.  Buckie, Cullen, Fochabers and Keith areas to Elgin and local hospitals. ',3,'Call us to book your trip. \r\nPhone: (01542) 835800','0',NULL,NULL,'2015-05-06 11:57:28',NULL),(39,'Banffshire Partnership Dial a Bus','Wheelchair accessible door to door service',3,'contact us: \r The Old School, Boyndie, Banff. AB45 2JT Tel: 01261 843598 FFFax: 01261 843598 E-mail: bpl.transport@banffdab.org.uk','0',NULL,NULL,'2015-05-06 12:06:48',NULL),(40,'M for Moray - Buckie service','Buckie area accessible on-demand bus.  ',3,'Contact us to book your trip. \r Dial M for Moray  Tel: 01343 562533 Email: transport@moray.gov.uk','0',NULL,NULL,'2015-05-06 12:14:16',NULL),(41,'M for Moray - Forres service','Forres area accessible on-demand bus.',3,'Contact us to book your trip.\r Dial M for Moray  Tel: 01343 562533 Email: transport@moray.gov.uk','0',NULL,NULL,'2015-05-06 12:20:52',NULL),(42,'M for Moray - Keith service','Keith area accessible on-demand bus.',3,'Contact us to book your trip.\r Dial M for Moray  Tel: 01343 562533 Email: transport@moray.gov.uk','0',NULL,NULL,'2015-05-06 12:30:39',NULL),(43,'M for Moray - Speyside service','Speyside area accessible on-demand bus. ',3,'Contact us to book your trip.\r Dial M for Moray  Tel: 01343 562533 Email: transport@moray.gov.uk','0',NULL,NULL,'2015-05-06 12:36:20',NULL),(44,'Turriff A2B service','Door to door service for those unable to use conventional PT.',3,'All journeys must be pre-booked by calling the dial-a-bus hotline on 01224 665599 between 9.30am and 3.30pm, Monday to Friday. To cancel a journey, please leave a message on the A2B cancellation line on 01224 665580, available 24 hrs a day','0',NULL,NULL,'2015-05-06 12:43:09',NULL),(64,'THInC Transport','Travel bla bla bla',3,'Phone THInC  minimum 24 hours before trip...','1',NULL,NULL,'2015-05-27 14:03:45',NULL);
